import styles from "./Card.module.css";
import { Link } from "react-router-dom";

const Card = ({attack, defense, hp, id,img,name, speed})=>{
    return (
        <div className={styles.cartita} >
            <Link to={`/detail/${id}`}> 
           {/* <button className={style.closebutoon} 
              onClick={()=>onClose(id)}>   X
           </button> */}
  
           <img  src={img} alt="" />
           <h2>Name: {name}</h2>
           <h2>Hp: {hp}</h2>
           <h2>Attack: {attack}</h2>
           <h2>Defense: {defense}</h2>
           <h2>Speed: {speed}</h2>

           <hr />
           </Link>
        </div>
     );

}

export default Card;
